title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o7886.m13 -> o7890.m0 -> o7886.m13
  o7890.m0 -> o7886.m13 -> o7890.m0
  o7890.m24 -> o7886.m13 -> o7890.m0 -> o7886.m13
  o7886.m33 -> o7890.m0 -> o7886.m13 -> o7890.m0

features:
  - inheritance
  - overriding
  - method
  - polymorphism

